// src/App.js
import React, { useEffect, useState } from 'react';
import InvestmentDashboard from './InvestmentDashboard';
import { getInvestmentData } from './googleSheetService';

function App() {
  const [data, setData] = useState({
    currentValue: '-',
    totalReturns: '-',
    returnsPercent: '-',
    invested: '-',
    xirr: '-',
    dayReturn: '-',
    dayReturnPercent: '-',
  });

  useEffect(() => {
    getInvestmentData().then(setData);
  }, []);

  return <InvestmentDashboard data={data} />;
}

export default App;
